import React from "react";
const Pagination = ({ total_page }) => {
  const pages = [...Array(total_page).keys()].map((num) => num + 1);
  console.log(pages);
  return (
    <div>
      {pages.map((num) => (
        <li className="page-item">
          <button
            className="page-link"
            onClick={() => {
              dispatch(loadPosts({num}));
            }}
          >
            {num}
          </button>
        </li>
      ))}
    </div>
  );
};

export default Pagination;
